def count_rna_strings(protein):
    # Codon count table (number of codons for each amino acid)
    codon_count = {
        'F': 2, 'L': 6, 'S': 6, 'Y': 2, 'C': 2,
        'W': 1, 'P': 4, 'H': 2, 'Q': 2, 'R': 6,
        'I': 3, 'M': 1, 'T': 4, 'N': 2, 'K': 2,
        'V': 4, 'A': 4, 'D': 2, 'E': 2, 'G': 4,
        # Stop codon has 3 possible codons
        'STOP': 3
    }

    # Initialize the total number of RNA strings
    total_rna_strings = 1
    MODULO = 1000000  # Use modulo 1,000,000 to handle large numbers

    # Calculate the product of codon counts for each amino acid in the protein
    for amino_acid in protein:
        total_rna_strings *= codon_count[amino_acid]
        total_rna_strings %= MODULO  # Apply modulo to keep the number manageable

    # Multiply by the number of possible stop codons
    total_rna_strings *= codon_count['STOP']
    total_rna_strings %= MODULO  # Final modulo operation

    return total_rna_strings

# Example usage
protein = ""
print(count_rna_strings(protein))